import logo from './LogoFinanceSync-sinfondo.png';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
      <nav class="barra-navegacion"/>
      <div className='logo'>
      <img src={logo} alt="LogoFinanceSync" width="226" height="50"/>
      </div>
      <p>
          Edit <code>src/App.js en</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
